import React from 'react'
import Employees from "./Employee.json"
import "./Emp.css"

const Empl = () => {
  return (
    <div className='parent'>
      {
        Employees && Employees.map(empl => {
          return (
            <div className='child'>
              <div id='data' align='center'>
                <h2 className='data'>Name : {empl.name}</h2>
                <h3 className='data'>Designation : {empl.designation}</h3>
                <h3 className='data'>Salary : {empl.salary}</h3>
              </div>
            </div>
          )
        })
      }
    </div>
  )
}

export default Empl;
